import React, { Component } from 'react';
import './home.css';

class Home extends Component {
    render() {
        return (
            <>
                <div className="background-div">

                    <div className="word text-center">
                        <h1>草莓奶油慕斯蛋糕</h1>
                        <p>堅持使用頂級原料，不含任何防腐劑。讓你吃得安心，看的到用心。</p>
                    </div>
                </div>
            </>
        );
    }
}

export default Home;
